class Solution(object):
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        if not grid or len(grid) == 0 or not grid[0] or len(grid[0]) == 0:
            return 0

        m = len(grid)
        n = len(grid[0])

        count = 0
        for i in range(m):
            for j in range(n):
                if self.helper(grid, i, j, m, n):
                    count += 1

        return count

    def helper(self, grid, x, y, m, n):
        if grid[x][y] == '1':
            grid[x][y] = '0'
            if x > 0:
                self.helper(grid, x - 1, y, m, n)
            if x < m - 1:
                self.helper(grid, x + 1, y, m, n)
            if y > 0:
                self.helper(grid, x, y - 1, m, n)
            if y < n - 1:
                self.helper(grid, x, y + 1, m, n)
            return True
        else:
            return False




